using System;
using System.Collections.Generic;
using System.Data.SqlClient;
using System.Linq;
using System.Web;

namespace OnlineShop.Models
{
    public class Product : Master
    {
        public List<Dictionary<string, string>> GetAll(string[] ids = null)
        {
            List<Dictionary<string, string>> result = new List<Dictionary<string, string>>();
            using (SqlConnection conn = new SqlConnection(constr))
            {
                conn.Open();
                string query = "SELECT * FROM SAN_PHAM";
                if (ids != null)
                {
                    string strids = String.Join("','", ids);
                    query += " WHERE MA_SAN_PHAM in('" + strids + "')";
                }
                SqlCommand command = new SqlCommand(query, conn);
                using (SqlDataReader reader = command.ExecuteReader())
                {
                    while (reader.Read())
                    {
                        Dictionary<string, string> temp = new Dictionary<string, string>();
                        temp.Add("MA_SAN_PHAM", String.Format("{0}", reader["MA_SAN_PHAM"]));
                        temp.Add("MA_THUONG_HIEU", String.Format("{0}", reader["MA_THUONG_HIEU"]));
                        temp.Add("MA_LOAI", String.Format("{0}", reader["MA_LOAI"]));
                        temp.Add("TEN_SAN_PHAM", String.Format("{0}", reader["TEN_SAN_PHAM"]));
                        temp.Add("GIA_GOC", String.Format("{0}", reader["GIA_GOC"]));
                        temp.Add("GIA_BAN", String.Format("{0}", reader["GIA_BAN"]));

                        //TODO: Select tu DB va chen cot hinh anh vao day
                        temp.Add("HINH_ANH", "");
                        result.Add(temp);
                    }
                }

                conn.Close();
            }
            return result;
        }

        public Dictionary<string, string> Get(string id)
        {
            Dictionary<string, string> result = new Dictionary<string, string>();
            using (SqlConnection conn = new SqlConnection(constr))
            {
                conn.Open();
                string query = "SELECT * FROM SAN_PHAM WHERE MA_SAN_PHAM = '" + id + "'";
                SqlCommand command = new SqlCommand(query, conn);
                using (SqlDataReader reader = command.ExecuteReader())
                {
                    if (reader.Read())
                    {
                        result.Add("MA_SAN_PHAM", String.Format("{0}", reader["MA_SAN_PHAM"]));
                        result.Add("MA_THUONG_HIEU", String.Format("{0}", reader["MA_THUONG_HIEU"]));
                        result.Add("MA_LOAI", String.Format("{0}", reader["MA_LOAI"]));
                        result.Add("TEN_SAN_PHAM", String.Format("{0}", reader["TEN_SAN_PHAM"]));
                        result.Add("GIA_GOC", String.Format("{0}", reader["GIA_GOC"]));
                        result.Add("GIA_BAN", String.Format("{0}", reader["GIA_BAN"]));

                        //TODO: Select tu DB va chen cot hinh anh vao day
                        result.Add("HINH_ANH", "");

                    }
                }

                conn.Close();
            }
            return result;
        }
    }
}